import React, { Component } from 'react';
import react from 'react';

import { Card, TextBox, PageMain, DatePicker, Delimiter, DropDown,Table, FileUploader,Label, CheckBox } from "core";
import NotificationSystem from 'react-notification-system';
import FacilityTypeSection from '../../sections/basePage/facilityTypeSection';


class FacilityTypeAddPage extends React.Component {
    constructor(props) {
        super(props);

        this.state = {};
        this.state= { updateKey: 1 };
        this.notificationSystem = React.createRef();

    }
    render() {
        return (
        
            <PageMain title=" فرم" icon="users" context={this} footerLinks={[{ href: "/", text: "صفحه اصلی" },{ href: "https://banksepah.ir", text: "وب سایت رسمی بانک سپه" }]}>
                 <FacilityTypeSection item={this.state}/>
            </PageMain>
        );
    }
}


export default FacilityTypeAddPage
